const Hello = () => {
  return (
    <div>
      <p>Hei maailma!</p>
    </div>
  );
};

const App = () => {
  const now = new Date();
  const a = 10;
  const b = 20;

  return (
    <div>
      <p>Hello world, it is {now.toString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
      <Hello />
    </div>
  );
};

export default App;

